  const content =
    '<p>두경부암</p><p><br></p><p>두경부암은 뇌, 뇌신경, 눈, 식도 등을 제외한 머리와 목 부위에 발생하는 암을 합쳐서 부르는 말로, 후두암, 인두암, 구강암, 비부비동암, 침샘암 등이 있으며, 이 중 흡연이 가장 확실한 발암 원인으로 꼽히는 암이 후두암, 구강암, 인두암입니다.</p><p>일본인 대상의 흡연과 두경부암 발병 및 사망률 관련 체계적 문헌고찰 및 메타분석 연구 결과에 따르면, 두경부암 발생과 사망 위험이 비흡연자 대비 흡연 경험자 2.4배, 현재 흡연자 2.7배, 과거 흡연자 1.5배 증가하였습니다. 또 다른 체계적 문헌고찰 연구에서는 전자담배와 두경부암 발병의 연관성을 확인할 수 있었으며, 이 연구에서 전자담배가 DNA 이중 가닥 파손 위험을 높이고 산화 스트레스를 포함한 시험관 내 손상을 유발할 수 있다는 증거를 제한적이나마 찾을 수 있었습니다.</p><p><br></p><p>한편, 음주 역시 두경부암의 대표적인 발병 원인으로, 음주와 흡연을 동시에 하는 경우 상승작용을 일으켜 암 발생 위험을 더욱 높입니다. 또한 일부 연구에서는 음주와 담배종류별 동반 사용에 대한 암 발생 위험을 확인하였으며, 음주와 일반담배(궐련) 및 무연담배 사용 시 암 발생위험이 16.2배로 가장 높았고, 음주와 무연담배 사용이 7.8배, 음주와 일반담배(궐련) 4.7배 순으로 나타났습니다.</p><p>금연은 가장 확실한 두경부암 예방책입니다. 금연을 하는 경우 두경부암의 발생 위험과 치료 및 예후에서 긍정적인 결과를 기대할 수 있습니다. 금연한 지 16년 지난 후부터는 후두암 발생 위험이 절반 수준으로 감소하며, 두경부암 환자가 금연하는 경우 치료 전, 치료 중 및 치료 후의 전 과정에 걸쳐 전체 생존율을 높이고 재발률을 줄이는 것으로 알려져 있습니다.</p><p><br></p><p class="ql-align-center"><img src="data:image/png;base64,"></p><p>끝입니다.</p><p><br></p>';

